import { makeStyles } from "@mui/styles";

export const useStyles = makeStyles({
  btn: {
    backgroundColor: "#f7989b",
    border: "none",
    borderRadius: 6,
    cursor: "pointer",
    color: "black",
    fontSize: 12,
    margin: "2px",
  },
});
